import serial  # 导入串口包
import re
import time  # 导入时间包
from PyQt5.QtWidgets import QApplication 
import sys



def decode_GSV(recv=None):
    #recv = b'$GPGSV,4,1,14,01,02,303,3,10,61,176,22,12,15,040,21,20,25,162,34*7B\r\n'
    out = []
    recv = recv.decode('gbk')
    recv = re.split(r'[,*]', recv)
    if recv[0] == '$GPGSV':
        s_type = 'GPS'
    elif recv[0] == '$GLGSV':
        s_type = 'GLONASS'
    for i in range(int((len(recv)-4)/4)):
        if recv[4*i+5] != '': elevation = float(recv[4*i+5]) 
        else: continue
        if recv[4*i+6] != '': azimuth = float(recv[4*i+6]) 
        else: continue
        if recv[4*i+7] != '': SNR = float(recv[4*i+7]) 
        else: continue
        out.append([s_type, elevation, azimuth, SNR])
    return out


    
def decode_GGA(states={}, recv=None): 
    #recv = b'$GNGGA,090150.00,2248.08982,N,11356.39224,E,1,12,0.94,84.6,M,-3.0,M,,*6C\r\n'
    recv = recv.decode('gbk')
    recv = re.split(r'[,*]', recv)
    if recv[0] == '$GNGGA':
        s_type = '混合定位'
    elif recv[0] == '$GPGGA':
        s_type = 'GPS定位'
    elif recv[0] == '$GLGGA':
        s_type = 'GLONASS定位'
    states['s_type'] = s_type
    states['local_time'] = recv[1]#(float(recv[1])+8e4)%24e4
    if recv[2] != '': states['latitude'] = str(float(recv[2])/100)
    states['latitude_diretion'] = recv[3]
    if recv[4] != '': states['longtitude'] = str(float(recv[4])/100)
    states['longtitude_diretion'] = recv[5]
    states['is_valid'] = recv[6]
        
def decode_RMC(states={}, recv=None):
    #recv = b"\x00\x00\x0eN\x0c\x07\x1f\x02\x1f\x00\xd4\x03\x00\x00\x0bO\r\x07'2\x0e\x00\xa7\xfe\xff\xff\x07P\r\x04\x14<\xf8\x00\xbe\xf9\xff\xff\xd9\xca\xb5b\x01\x03\x10\x00\x80~\xd6 \x03\xdd\x00\x08\x7f\x05\x00\x00G\x02\t\x00\xc6]$GNRMC,090150.00,A,2248.08982,N,11356.39224,E,0.059,,311020,,,A*67\r\n"
    recv = re.split(r'[,*]', str(recv))
    states['local_time_year'] = recv[-5]
    states['diretion'] = recv[-6]
    states['speed'] = recv[-7]

def main():
    ser = serial.Serial("COM4",9600,timeout = 5)  
    ser.flushInput()  
    states = {} #定位方式，时分秒，年月日，维度，南/北，精度，东/西（这样可以缓存），航向，速率
    while True:
        count = ser.inWaiting() 
        if count !=0 :
            recv = ser.readlines(ser.in_waiting)
            satellites = []
            for r in recv:
                if 'SGV' in r:
                    satellites = decode_GSV(satellites, r) #卫星个数可用len(satellites)
                elif 'GGA' in r:
                    decode_GGA(states, r)
                elif 'RMC' in r:
                    decode_RMC(states, r)
        time.sleep(0.1)  



    
    
    
    
